//{{{  nodeStruct

function nodeStruct () {

  this.ply             = 0;
  this.childNode       = null;
  this.parentNode      = null;
  this.grandparentNode = null;

  this.moves = new Uint32Array(MAX_MOVES);
  this.ranks = new Uint32Array(MAX_MOVES);

  this.killer1     = 0;
  this.killer2     = 0;
  this.mateKiller  = 0;
  this.numMoves    = 0;
  this.sortedIndex = 0;
  this.hashMove    = 0;
  this.hashEval    = 0;
  this.base        = 0;
  this.inCheck     = 0;
  this.ev          = 0;

  this.rights = 0;
  this.ep     = 0;
  this.repLo  = 0;
  this.repHi  = 0;
  this.loHash = 0;
  this.hiHash = 0;

  this.net_h1_a = new Int32Array(NET_H1_SIZE);
  this.net_h2_a = new Int32Array(NET_H1_SIZE);

  this.toZ = 0;
  this.frZ = 0;
  this.epZ = 0;

  this.pv = new Uint32Array(MAX_MOVES);
  this.pvLen = 0;

}

