//{{{  formatFen

function formatFen (turn) {

  var fen = '';
  var n   = 0;

  for (var i=0; i < 8; i++) {
    for (var j=0; j < 8; j++) {
      var sq  = B88[i*8 + j]
      var obj = bdB[sq];
      if (obj === 0)
        n++;
      else {
        if (n) {
          fen += '' + n;
          n = 0;
        }
        fen += UMAP[obj];
      }
    }
    if (n) {
      fen += '' + n;
      n = 0;
    }
    if (i < 7)
      fen += '/';
  }

  if (turn === WHITE)
    fen += ' w';
  else
    fen += ' b';

  if (bdRights) {
    fen += ' ';
    if (bdRights & WHITE_RIGHTS_KING)
      fen += 'K';
    if (bdRights & WHITE_RIGHTS_QUEEN)
      fen += 'Q';
    if (bdRights & BLACK_RIGHTS_KING)
      fen += 'k';
    if (bdRights & BLACK_RIGHTS_QUEEN)
      fen += 'q';
  }
  else
    fen += ' -';

  if (bdEp)
    fen += ' ' + COORDS[bdEp];
  else
    fen += ' -';

  fen += ' 0 1';

  return fen;

}

