//{{{  addHistory

function addHistory (x, move) {

  objHistory[
    (((move & MOVE_FROBJ_MASK) >>> MOVE_FROBJ_BITS) << 8) +
    ((move & MOVE_TO_MASK) >>> MOVE_TO_BITS)
  ] += x;

}

//}}}
//{{{  betaMate

function betaMate (score) {

  return (score >= MINMATE && score <= MATE) | 0;

}

//}}}
//{{{  alphaMate

function alphaMate (score) {

  return (score <= -MINMATE && score >= -MATE) | 0;

}

